// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./LandStructs.sol";
import "./LandRoles.sol";

abstract contract LandStorage is LandStructs, LandRoles {
    uint256 public landCounter;

    event LandRegistered(uint256 indexed landId, address indexed owner);
    event LandApproved(uint256 indexed landId);
    event OwnershipTransferred(uint256 indexed landId, address indexed from, address indexed to);
    event LandListed(uint256 indexed landId, uint256 price);
    event LandSold(uint256 indexed landId, address indexed from, address indexed to, uint256 price);

    modifier onlyOwner(uint256 _landId) {
        require(lands[_landId].owner == msg.sender, "Not land owner");
        _;
    }
}
